import React, { Component } from 'react';

export default class MainPage extends Component {
	render() {
		return (
			<div className="MainPage">
				<div className="MainText">
					<p>I<code>'</code>M</p>
					<p>FRONT</p>
					<p>DEVELOPER<code>.</code></p>
				</div>
				<div className="SubText">
					<p>더 나은 웹 개발자를 원하십니까?</p>
				</div>
			</div>
		);
	}
};
